import React from 'react'
import { Button, FormGroup, Label, Input, FormText, Container, FormControl } from 'reactstrap';
import "bootstrap/dist/css/bootstrap.css";

function Login() {
        return (
        <Container className="custom-text">
            <h1 id="contact-me-title">Login:</h1>
            <FormGroup id="contact-me-form">
                <h4>Enter username and password below to login!</h4>
                <br></br>
                <FormGroup controlId="formGroupEmail">
                    <Label><h4>Email</h4></Label>
                    <FormControl type="email"placeholder="Enter email" />
                </FormGroup>
                <FormGroup>
                    <Label for="exampleEmail"><h4>Email</h4></Label>
                    <Input type="email" name="email" id="exampleEmail" placeholder="na@example.com" />
                </FormGroup>
                <Button>Submit</Button>
            </FormGroup>
        </Container>
    );
}

export default Login;
